const initialState = {
    location: "",
    page: 'start'
}

const appReducer = (state = initialState, action) => {
    switch(action.type){
    case 'LOC_CHANGE': 
    // do something
    return 
        [...state,  {location: action.location}]

    default:
    return state;
    }
}

export default appReducer;
